: scale range error:', min, max, range);\n    };\n}\n\nclearTimeout(window._bt_autoscale_timeout);\n\nwindow._bt_autoscale_timeout = setTimeout(function () {\n    /**\n     * @variable cb_obj `fig_ohlc.x_range`.\n     * @variable source `ColumnDataSource`\n     * @variable ohlc_range `fig_ohlc.y_range`.\n     * @variable volume_range `fig_volume.y_range`.\n     */\n    \"use strict\";\n\n    let i = Math.max(Math.floor(cb_obj.start), 0),\n        j = Math.min(Math.ceil(cb_obj.end), source.data['ohlc_high'].length);\n\n    let max = Math.max.apply(null, source.data['ohlc_high'].slice(i, j)),\n        min = Math.min.apply(null, source.data['ohlc_low'].slice(i, j));\n    _bt_scale_range(ohlc_range, min, max, true);\n\n    if (volume_range) {\n        max = Math.max.apply(null, source.data['Volume'].slice(i, j));\n        _bt_scale_range(volume_range, 0, max * 1.03, false);\n    }\n\n}, 50);\n"},"id":"712986","type":"CustomJS"},{"attributes":{"line_color":{"value":"#bbbbbb"},"x0":{"field":"index"},"x1":{"field":"index"},"y0":{"field":"High"},"y1":{"field":"Low"}},"id":"712865","type":"Segment"},{"attributes":{},"id":"712684","type":"AllLabels"},{"attributes":{"axis":{"id":"712832"},"coordinates":null,"dimension":1,"group":null,"ticker":null},"id":"712835","type":"Grid"},{"attributes":{},"id":"712688","type":"Selection"},{"attributes":{"factors":["0","1"],"palette":["rgb(255.0, 220.40869565217392, 214.20000000000002)","rgb(214.20000000000005, 254.99999999999997, 214.20000000000005)"]},"id":"712870","type":"CategoricalColorMapper"},{"attributes":{},"id":"712791","type":"SaveTool"},{"attributes":{"line_color":{"field":"returns_positive","transform":{"id":"712619"}},"line_dash":{"value":"dotted"},"line_width":{"value":8},"xs":{"field":"position_lines_xs"},"ys":{"field":"position_lines_ys"}},"id":"712890","type":"MultiLine"},{"attributes":{"source":{"id":"712616"}},"id":"712894","type":"CDSView"},{"attributes":{"overlay":{"id":"712843"}},"id":"712838","type":"BoxZoomTool"},{
